import React from 'react'
import { Particles } from "react-particles-js";

export default function HomeBAW(props) {
    return (
        <div className="homeBAW" id="home">
            <Particles 
            params={{
                'color': 'black',
                "particles": {
                    "number": {
                        "value": 50
                    },
                    "size": {
                        "value": 3
                    }
                },
                "interactivity": {
                    "events": {
                        "onhover": {
                            "enable": true,
                            "mode": "repulse"
                        }
                    }
                }
            }} />
        </div>
    )
}
